import {PURPLE} from "../../helpers/colors";
import './Navbar.css';

const Navbar = () => {
    return (
        <>
            <nav className="navbar navbar-dark bg-dark">
                <div>
                    <i className="fas fa-id-badge mx-2 icon-style" style={{color: PURPLE}}></i>
                    <span className="navbar-brand" style={{color: PURPLE}}> Contact Manager App</span>
                </div>
            </nav>
        </>
    )
}
export default Navbar;
